    [],nt"revision_timestamp": "2016-02-12T20:33:18.647727",nt"name": "quail-hunt-zones-ds1342",nt"isopen":
    false,nt"url": null,nt"notes": "Mapped hunt boundary is an approximation
    of regulations using best available data as of September 2015. Hunters are responsible
    for knowing the exact current boundary locations as described within the California
    Code of Regulations, Title 14, Section Quail 300(a)(1)(B)3:3. Area Zone Descriptions:a.
    Zone Q1: The early mountain quail season hunting zone includes the counties of Alpine,
    Butte, Del Norte, Glenn, Humboldt, Inyo, Lassen, Modoc, Mono, Plumas, Shasta, Sierra,
    Siskiyou, Tehama, Trinity, and those portions of Amador, Calaveras, El Dorado, Fresno,
    Madera, Mariposa, Nevada, Placer, Tuolumne, Tulare, and Yuba counties lying east
    of the western boundary of the national forests.b. Zone Q2: The early coastal quail
    season (all species) hunting zone includes the counties of Marin, Napa, Solano,
    Sonoma, Lake, and Mendocino.c. Zone Q3: The balance of the state season (all species)
    hunting zone includes the remaining land area not included in Zone Q2 (the counties
    of Marin, Napa, Solano, Sonoma, Lake, and Mendocino).",nt"license_title": null,nt"extras":
